import { Children, Fragment } from "react";
import Header from "../../header";
import Footer from "../../footer"
import "./style.css"
export function DefaultLayout(props){
    const {children} = props; 
    return (
        <Fragment>
            <Header/>
                {Children}
            <Footer/>
        </Fragment>
    )
}
export default DefaultLayout;
